INSERT INTO `TB_Imovel` (`id_imovel`, `titulo`, `descricao`, `preco`, `endereco`, `data_anuncio`, `id_tipo`, `id_regiao`, `id_usuario`, `id_plano`, `status`) VALUES
(1, 'Levamur superstitione, liberamur mortis metu.', 'Quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri.', '80185.21', '5785 Groesser Place', '2025-04-22', '100', '4', '58', '42', 'Disponível'),
(2, 'Epicureum esse, si probarem, quae ille diceret? Cum praesertim illa perdiscere ludus esset. Quam ob ', 'Voluptatem, aut cum Latinis tertio consulatu conflixisse apud Veserim propter voluptatem; cum autem usus progrediens familiaritatem effecerit, tum.', '104164.34', '4052 Espinoza Lane', '2024-12-21', '18', '8', '32', '91', 'Alugado'),
(3, 'Fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile efficere possit, q', 'Declarant, sed videntur leviora, veniamus. Quid tibi, Torquate, quid huic Triario litterae, quid historiae cognitioque rerum, quid poetarum evolutio, quid.', '122520.46', '6513 Kranz Avenue', '2024-06-06', '36', '36', '26', '26', 'Indisponível'),
(4, 'Esse non possunt, victi et debilitati obiecta specie voluptatis tradunt se libidinibus constringendo', 'Perspicuum est, maximam animi aut voluptatem aut molestiam plus aut ad naturam aut contra sit, a natura ipsa iudicari. Ea quid percipit aut quid malum, sensu iudicari, sed animo etiam ac ratione intellegi posse et voluptatem pleniorem efficit. Itaque non ob ea.', '80923.74', '9402 Scotia Street', '2025-01-16', '89', '11', '24', '29', 'Vendido'),
(5, 'Eo quidem consilio, tuum iudicium ut cognoscerem, quoniam mihi.', 'Etiam, ut te consule, ipsi se indicaverunt. Quodsi qui satis sibi contra hominum conscientiam saepti esse et voluptates.', '94678.64', '4637 Callaway Drive', '2024-07-24', '50', '20', '79', '4', 'Alugado'),
(6, 'Posse a voluptate aut a voluptate aut in dolore. Omnis autem privatione doloris putat Epicurus termi', 'Tenere possumus neque vero ipsam amicitiam tueri, nisi aeque amicos et nosmet ipsos diligamus, idcirco et hoc ipsum efficitur in amicitia, et amicitia cum voluptate conectitur. Nam et ipsa declinatio ad libidinem fingitur -- ait enim declinare atomum sine causa; quo nihil posset fieri.', '105761.81', '11201 Bosie Run', '2024-06-20', '77', '14', '77', '35', 'Vendido'),
(7, 'Ait ille, sciscat et probet, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et ex', 'Afficit cum vi sua atque natura, quod tranquillat animos, tum spe nihil earum rerum defuturum, quas natura non depravata desiderat.', '82403.72', '1369 Woodbreeze Place', '2024-09-12', '27', '44', '44', '45', 'Disponível'),
(8, 'Doctrina philosophi Graeco sermone tractavissent, ea Latinis litteris mandaremus, fore ut hic noster', 'Iisque M. Brutus dissentiet -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id omnia referri.', '86168.39', '4150 Towana Loop', '2025-02-26', '45', '38', '10', '17', 'Indisponível'),
(9, 'Ad sapientiam perveniri potest, non paranda nobis solum ea, sed fruenda etiam sapientia est; sive ho', 'Suscipit, ut non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis aut poetis, postea quidem.', '115411.32', '7523 Malmaison Street', '2024-09-11', '54', '65', '83', '80', 'Disponível'),
(10, 'A nostris de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scie', 'Variari voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e patre audiebam facete et urbane Stoicos irridente, statua est in Ceramico Chrysippi sedentis porrecta manu, quae manus significet illum in hae esse rogatiuncula delectatum: ''Numquidnam manus.', '90216.52', '7752 Lussier Court', '2024-06-11', '42', '9', '54', '70', 'Indisponível'),
(11, 'Nec me tamen laudandis maioribus meis corrupisti nec segniorem ad respondendum reddidisti. Quorum fa', 'Tu tam egregios viros censes tantas res gessisse sine causa? Quae fuerit causa, mox videro; interea hoc tenebo, si ob aliquam causam ista, quae.', '109185.73', '738 Fieldcrest Street', '2025-02-20', '15', '83', '18', '1', 'Alugado'),
(12, 'Delectant. Est autem situm in nobis ut et voluptates et dolores animi quam corporis. Nam.', 'Mundi ornatum efficere non poterit. Ne illud quidem adduci vix possum, ut ea, quae corrigere vult, mihi quidem videtur. Ac fieri potest, ut errem, sed ita sentio et saepe etiam videmus, et perspicuum est omnis rectas res atque laudabilis eo referri, ut.', '112336.79', '7236 Cumbaa Court', '2024-09-26', '98', '22', '96', '18', 'Vendido'),
(13, 'Splendore nominis capti quid natura desideret. Tum vero, si stabilem scientiam rerum tenebimus, serv', 'Nihil tranquilli potest. Quodsi vitam omnem perturbari videmus errore.', '94765.62', '12220 James Island Street', '2024-07-29', '80', '70', '73', '58', 'Indisponível'),
(14, 'Sentio et saepe disserui, Latinam linguam non modo non.', 'Mihi legendam putem, de quo quaerimus, non quo ignorare vos arbitrer, sed ut ratione et.', '121031.44', '12299 Jersey Terrace', '2025-02-28', '83', '13', '28', '32', 'Alugado'),
(15, 'In geometriaque perfecto, huic pedalis fortasse; tantum enim esse censet, quantus videtur, vel paulo', 'Offendit noster minime nobis iniucundus labor. Iis igitur est difficilius satis facere, qui se Latina scripta dicunt contemnere. In quibus tam.', '124831.65', '5782 Brassie Terrace', '2024-11-08', '47', '86', '15', '2', 'Vendido'),
(16, 'Cives mei, nec cum iracundia.', 'In adoptionem D. Silano emancipaverat, ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia.', '122561.20', '12068 Glenarden Path', '2024-10-01', '39', '88', '97', '73', 'Disponível'),
(17, 'Dicantur, cur nec voluptas in bonis sit numeranda nec in malis dolor, non existimant oportere nimium', 'Eorum animi noctesque diesque exeduntur, a diis inmortalibus sine ullo metu vera sentit, non dubitat, si ita res se habeat. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est cur dubitemus.', '109515.87', '4871 Boudreau Circle', '2025-04-19', '33', '2', '98', '34', 'Vendido'),
(18, 'Dissident atque discordant, ex quo vitam amarissimam necesse est in.', 'Meo arbitratu facerem, ante hoc tempus numquam est iniuria, quae autem de bene beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur.', '95729.35', '2264 Ridgeland Path', '2024-11-04', '78', '17', '63', '36', 'Disponível'),
(19, 'Etiam cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo inventore veritatis et quasi inv', 'Obligantur. Qui autem alia malunt scribi a nobis, aequi esse debent.', '106467.05', '4912 Gloverville Terrace', '2024-11-04', '48', '26', '33', '28', 'Indisponível'),
(20, 'Artem tantam tamque et operosam et perinde fructuosam relinqueret? Non ergo Epicurus ineruditus, sed', 'Defendit Epicurus neque Metrodorus aut quisquam eorum, qui aut saperet.', '93753.15', '6734 Wilson Way', '2025-02-23', '25', '37', '82', '21', 'Alugado'),
(21, 'Eum unum secutus esset, nollem.', 'Solida utilitas omnisque puerilis est delectatio, aut se, ut Plato, in musicis, geometria, numeris, astris contereret, quae et terroribus cupiditatibusque detractis et omnium falsarum.', '118970.31', '8292 Jem Path', '2025-04-06', '28', '82', '87', '68', 'Disponível'),
(22, 'Defenditur, tamen eius modi tempora incidunt, ut labore et dolore magna.', 'Arbitratu facerem, ante hoc tempus numquam est rem, ad id omnia referri oporteat, ipsum autem nusquam. Hoc Epicurus in voluptate ponatur, sed sine hoc institutionem omnino.', '116410.89', '1724 Brett Way', '2025-02-06', '52', '94', '3', '10', 'Indisponível'),
(23, 'Sententia permanentes, quas ob causas in eorum vita nulla est intercapedo molestiae. Igitur neque st', 'Qui me ad alias litteras vocent, genus hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus.', '97740.94', '5220 Iron Wood Lane', '2025-02-20', '68', '30', '17', '20', 'Alugado'),
(24, 'Appareat, doctrina mediocris. Ego autem quem timeam lectorem, cum ad me accedis, saluto: ''chaere,'' i', 'Ratio late patet. In quo enim maxime consuevit iactare vestra se oratio, tua praesertim, qui studiose antiqua persequeris.', '113968.29', '2229 Rahilly Road', '2025-01-02', '82', '77', '41', '16', 'Vendido'),
(25, 'Fingi potest? Quodsi vita doloribus referta maxime fugienda est, summum profecto malum est vivere cu', 'Cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus omnes.', '108171.11', '6330 Ava Street', '2024-06-20', '59', '34', '69', '53', 'Disponível'),
(26, 'Nihil oportere exquisitis rationibus confirmare, tantum satis esse.', 'Huius disciplinae placet: constituam, quid et quale sit id, de quo quaerimus, non quo ignorare vos arbitrer, sed.', '115821.37', '14708 Conley Court', '2024-07-03', '69', '72', '84', '92', 'Vendido'),
(27, 'Comparandae voluptatis -- Quam autem ego dicam voluptatem, iam videtis, ne invidia verbi labefactetu', 'Oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae.', '105536.50', '3671 Logan Street', '2024-09-22', '74', '81', '23', '15', 'Alugado'),
(28, 'Cillum dolore eu fugiat nulla pariatur. Excepteur sint.', 'Animo autem et laetitiam nobis voluptas animi et molestiam dolor.', '114938.78', '8443 Mariel Way', '2024-12-27', '11', '21', '45', '64', 'Indisponível'),
(29, 'Difficiles, lucifugi, maledici, monstruosi, alii autem etiam amatoriis levitatibus dediti, alii petu', 'Quae sequamur et quae vel aliter pararetur et qua etiam carere possent sine dolore tum in dedecora incurrunt, saepe etiam legum iudiciorumque poenis obligantur. Qui autem.', '109037.20', '3497 Braddy Court', '2025-01-11', '19', '5', '39', '93', 'Vendido'),
(30, 'Iucundo motu voluptatis. Sin autem summa voluptas est, ut omne, quo offendimur, dolor, doloris omnis', 'Vel extremum -- quod et.', '112367.36', '13496 Canebrake Court', '2025-02-25', '3', '15', '64', '83', 'Disponível'),
(31, 'Quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem.', 'Cupiditatibusque detractis et omnium falsarum opinionum temeritate derepta certissimam se nobis ducem praebeat ad voluptatem. Sapientia enim est a Chrysippo praetermissum in Stoicis? Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium.', '91464.18', '3167 Alcona Avenue', '2025-03-24', '44', '57', '68', '66', 'Alugado'),
(32, 'Libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos confi', 'Irridente, statua est in voluptate aut a voluptate aut in armatum hostem impetum fecisse aut in poetis evolvendis, ut ego et Triarius te hortatore facimus, consumeret, in quibus nulla solida utilitas omnisque puerilis est delectatio, aut se, ut Plato, in musicis, geometria.', '95109.33', '7295 MacKenzie Avenue', '2025-01-29', '79', '7', '13', '12', 'Indisponível'),
(33, 'Animi, id est vel summum bonorum vel ultimum vel extremum .', 'Expetendam esse dicemus, sed quia maiores consequatur. Eadem fortitudinis ratio reperietur. Nam neque laborum perfunctio neque perpessio dolorum per se.', '107264.94', '13205 Oviedo Road', '2024-08-07', '64', '79', '7', '13', 'Indisponível'),
(34, 'Aegritudo sequatur, si illa mala sint, laetitia, si bona. O praeclaram beate vivendi et apertam et s', 'Propterea quod ipsa natura, ut ait ille, sciscat et probet, id est incorruptis atque integris testibus, si infantes pueri, mutae.', '116244.72', '8656 Indale Place', '2024-05-19', '49', '62', '91', '95', 'Disponível'),
(35, 'Venisset, pauca primo inter nos ea, quae sint coniuncta explicabo brevi. Nullus in ipsis error est f', 'Mundus omnesque partes mundi, quaeque in eo essent. Quae cum tota res (est.', '104608.90', '12315 Kaufman Circle', '2024-11-10', '95', '66', '76', '51', 'Vendido'),
(36, 'Inmortalibus supplicii causa importari putant. Quae autem tanta ex improbis factis ad minuendas vita', 'Appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a dolore. Quod cum ita sit, perspicuum est nihil desiderare manum, cum ita sit, perspicuum est omnis rectas res atque laudabilis eo referri, ut cum voluptate vivatur. Quoniam autem id est sint occaecat cupidatat non proident, sunt in culpa, qui officia deserunt mollit anim id est.', '77506.61', '1103 Turnberry Lane', '2024-09-29', '61', '85', '47', '31', 'Alugado'),
(37, 'Mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et.', 'Vel ingenii liberalitati magis conveniunt, qua qui affecti sunt in eadem causa sunt, qua ante quam nati, et ad usus civium non inutile, nosque ea scripta reliquaque eiusdem.', '82975.51', '9957 Bower Lane', '2024-11-15', '46', '92', '99', '6', 'Indisponível'),
(38, 'Non tam solido quam splendido nomine.', 'Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem angusta, quam magnos quantaque.', '121964.89', '8526 Brunell Street', '2024-07-22', '84', '48', '34', '89', 'Alugado'),
(39, 'Necessitatibus saepe eveniet, ut et voluptates et dolores nasci fatemur.', 'Dixi, constituto, ut aut voluptates omittantur maiorum voluptatum adipiscendarum causa aut dolores suscipiantur maiorum dolorum effugiendorum gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus.', '86973.45', '11193 San Bernadino Way', '2024-05-19', '71', '55', '86', '82', 'Vendido'),
(40, 'Hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit.', 'Rerum, e qua ipsa horribiles existunt saepe formidines.', '77493.88', '5019 Mitchell Place', '2024-10-11', '37', '24', '38', '3', 'Disponível'),
(41, 'Veriusque quam Stoici. Illi enim negant esse bonum quicquam nisi nescio quam illam umbram, quod appe', 'Animadversionis metu contineret, saluti prospexit civium, qua intellegebat contineri.', '119859.31', '6830 Agnew Terrace', '2024-12-02', '66', '46', '21', '81', 'Vendido'),
(42, 'Augendas, cum conscientia factorum, tum poena legum odioque civium? Et tamen in quibusdam neque pecu', 'Non placuit Epicuro medium esse quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium videretur, cum omni dolore careret, non modo fautrices fidelissimae, sed etiam effectrices sunt voluptatum tam amicis quam sibi, quibus non.', '94051.95', '4913 Christopher Court', '2024-08-01', '10', '53', '90', '24', 'Disponível'),
(43, 'Aegritudine possit et sine metu vivere. Quae est enim in vita tantopere quaerendum quam cum omnia in', 'Scribere? Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, quod huc possit, quod conetur, nec optinere, si effecerit, et.', '93299.91', '4911 Pageland Way', '2025-03-26', '58', '74', '70', '7', 'Alugado'),
(44, 'Utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non expeteretur, si nihil', 'Nec assiduitas nec vigiliae nec ea ipsa, quae laudatur, industria, ne fortitudo quidem, sed ista sequimur, ut sine cura metuque vivamus.', '92507.73', '10143 Cardinal Court', '2024-10-28', '65', '42', '71', '50', 'Indisponível'),
(45, '-- Nihil sane. -- ''At, si voluptas summum sit bonum, affirmatis nullam omnino fore. De qua Epicurus ', 'Poterit. Ne illud quidem adduci vix.', '85210.58', '13558 Caulk Court', '2024-09-19', '30', '49', '29', '39', 'Vendido'),
(46, 'Epicuri propriae ruinae: censet enim eadem illa constituto veri a falso distinctio traditur. Restat ', 'Nos exhorrescere metu non sinat. Qua praeceptrice in tranquillitate vivi potest omnium cupiditatum ardore restincto. Cupiditates enim sunt insatiabiles, quae non modo nullam captet, sed etiam effectrices sunt voluptatum tam amicis quam sibi, quibus non solum praesentibus fruuntur, sed etiam praetereat omnes voluptates, dolores denique quosvis suscipere malit.', '92476.81', '3492 Ravine Road', '2025-04-27', '75', '67', '61', '63', 'Disponível'),
(47, 'Illa Torquatis.'' Numquam hoc ita defendit Epicurus neque Metrodorus aut quisquam eorum, qui aut sape', 'Una virtute ponunt et splendore nominis capti quid natura postulet non intellegunt, errore maximo, si Epicurum audire voluerint, liberabuntur: istae.', '115155.16', '6299 Pensacola Place', '2024-07-08', '14', '12', '92', '60', 'Alugado'),
(48, 'Adhuc nec mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et erant illa Torquatis.'' Numquam', 'Laetitiam nobis voluptas animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore et ad corpus referri, nec ob eam causam non fuisse. -- Torquem detraxit hosti. -- Et quidem.', '101395.11', '6522 Barnhill Lane', '2024-06-13', '17', '73', '5', '90', 'Indisponível'),
(49, 'Et complectitur verbis, quod vult, et dicit plane, quod intellegam; et tamen in quibusdam neque pecu', 'Meminerunt, praesentibus non fruuntur, futura modo expectant, quae quia certa esse non possunt.', '119166.36', '8177 San Lorenzo Court', '2024-06-10', '7', '32', '89', '59', 'Disponível'),
(50, '--, quod ipsum nullam ad aliam rem, ad id autem res referuntur omnes.', 'Est usus Epicurus? Qui unum genus posuit earum cupiditatum, quae essent et naturales et necessariae, alterum, quae naturales essent nec.', '109158.80', '6908 Hengan Place', '2024-10-15', '31', '80', '49', '46', 'Alugado'),
(51, 'Commemorandis eorumque factis non emolumento aliquo, sed ipsius honestatis decore laudandis, id totu', 'Ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel optime scripserit Electram, tamen male conversam Atilii mihi legendam.', '110712.35', '1079 Day Drive', '2025-02-04', '26', '25', '80', '9', 'Indisponível'),
(52, 'Inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos ad', 'Ratio, quae plerisque notissima est. Quam a nobis sic intelleges eitam, ut ab Homero Ennius, Afranius a Menandro solet. Nec vero, ut noster Lucilius, recusabo, quo minus id.', '94192.40', '12623 Coleman Drive', '2024-09-08', '97', '64', '67', '75', 'Vendido'),
(53, 'Et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate aut a voluptate aut i', 'A falsis initiis profecta vera esse non possunt et, si essent vera, nihil afferrent, quo iucundius, id est.', '106836.79', '13166 Guarino Lane', '2024-11-21', '29', '68', '85', '61', 'Disponível'),
(54, 'Atque insitam in animis nostris inesse notionem, ut alterum esse.', 'Conturbamur ignoratione rerum, e qua ipsa horribiles existunt saepe formidines. Denique etiam morati melius erimus, cum didicerimus quid natura desideret. Tum vero, si stabilem scientiam rerum tenebimus, servata illa, quae quasi titillaret sensus, ut ita ruant.', '121671.42', '7077 Pacolet Terrace', '2024-07-24', '62', '93', '36', '40', 'Alugado'),
(55, 'Et praesentibus ita potitur, ut animadvertat quanta.', 'Igitur, quid sit extremum et ultimum bonorum, quod omnium philosophorum sententia tale debet esse, ut ad id autem res referuntur omnes, fatendum est summum esse bonum iucunde vivere. Id qui in ea voluptate velit esse cillum.', '107035.38', '12721 Parnassus Court', '2025-01-08', '1', '50', '59', '76', 'Indisponível'),
(56, 'Beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam Stoici. Illi enim negant ', 'Expetendam esse dicemus, sed quia pacem animis afferat et eos quasi concordia quadam placet ac leniat. Temperantia est enim, quae in rebus aut expetendis aut fugiendis ut.', '108076.33', '7572 Lesiege Lane', '2025-01-08', '32', '52', '40', '67', 'Vendido'),
(57, 'Dictum est, sic amicitiam negant posse a voluptate aut in dolore, sed in his rebus.', 'Ullus nec finis inveniri potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque.', '93540.68', '6062 Lone Oak Loop', '2024-05-08', '91', '6', '22', '97', 'Disponível'),
(58, 'Affecta, quem ad modum sit affectus, eum necesse est effici, ut sapiens solum amputata circumcisaque', 'Fieri quicquam sine causa dicere, -- et illum motum naturalem omnium ponderum, ut ipse constituit, e regione inferiorem locum petentium sine causa eripuit atomis.', '78820.45', '8972 Eads Terrace', '2024-06-16', '99', '3', '30', '14', 'Vendido'),
(59, 'Quibus rebus intellegitur nec intemperantiam propter se ipsos amentur. Etenim si delectamur, cum scr', 'Non possunt et, si essent vera, nihil afferrent, quo iucundius, id est quae sunt vitae sine metu degendae praesidia firmissima. -- Filium morte multavit. -- Si sine.', '119782.60', '8574 Hayward Path', '2024-08-18', '9', '16', '52', '65', 'Indisponível'),
(60, 'Improborum facta primo suspicio insequitur, dein sermo atque fama, tum accusator, tum iudex; Multi e', 'Summumque malum dolorem, idque instituit docere sic: Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem aspernari ut summum malum et, quantum possit, a se repellere, idque facere nondum depravatum ipsa natura incorrupte atque integre iudicante. Itaque negat opus esse ratione neque disputatione.', '112819.77', '1882 McKay Avenue', '2024-10-07', '67', '1', '14', '43', 'Alugado'),
(61, 'Potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in', 'Dicere, -- et illum motum.', '101709.86', '4754 Wettstein Way', '2024-11-22', '2', '54', '100', '33', 'Indisponível'),
(62, 'Probo, inquam. De cetero vellem equidem aut ipse doctrinis fuisset instructior -- est enim, quod tib', 'Enim cupiditates a natura proficiscuntur, facile explentur sine ulla iniuria, quae autem inanes sunt.', '96930.77', '1858 Toby Terrace', '2024-07-10', '23', '28', '66', '30', 'Alugado'),
(63, 'Vituperari nec fortitudinem patientiamque laudari suo nomine, sed illas reici, quia dolorem pariant,', 'Corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit.', '83978.39', '11266 Norwood Street', '2025-04-02', '21', '91', '50', '79', 'Vendido'),
(64, 'Enim virtutes, de quibus ante dictum est, sic amicitiam negant posse a voluptate discedere. Nam cum ', 'Et iis, quos modo nominavi, cum inciderit, ut id meo arbitratu facerem, ante hoc tempus numquam est possim accommodare Torquatos nostros? Quos tu paulo ante collegi, abest plurimum et, cum stultorum vitam cum sua comparat, magna afficitur voluptate. Dolores.', '97136.59', '5527 Puccio Terrace', '2024-11-12', '90', '27', '6', '87', 'Disponível'),
(65, 'Instituit docere sic: Omne animal, simul.', 'Vitae degendae et rerum gerendarum. Sic e physicis et fortitudo sumitur contra mortis timorem et constantia contra metum religionis et sedatio animi omnium rerum occultarum ignoratione sublata et moderatio natura cupiditatum generibusque earum explicatis, et, ut dixi, ad lineam.', '85468.13', '11707 Bowen Terrace', '2024-07-25', '96', '99', '65', '78', 'Alugado'),
(66, 'Epicuro scriptum est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio', 'Sit, si nihil tale metuamus. Iam.', '98131.06', '5590 Ravenel Court', '2024-09-18', '87', '31', '48', '98', 'Disponível'),
(67, 'Conficiuntur et angore et metu maximeque cruciantur, cum sero sentiunt frustra se aut pecuniae studu', 'Integris testibus, si infantes pueri, mutae etiam bestiae paene loquuntur magistra ac duce natura nihil esse prosperum nisi voluptatem, nihil asperum.', '91303.87', '10309 Albatross Avenue', '2024-12-18', '73', '60', '2', '94', 'Vendido'),
(68, 'Deinde hoc quoque alienum; nam ante Aristippus, et ille melius. Addidisti ad extremum etiam indoctum', '-- Filium morte multavit. .', '117990.04', '12903 Whalin Way', '2025-03-14', '92', '35', '57', '100', 'Indisponível'),
(69, 'Causa haec finxerat, assecutus est. Nam si omnes atomi declinabunt, nullae umquam cohaerescent, sive', 'Reprimique non potest, ut non modo fautrices fidelissimae, sed etiam quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima.', '91654.57', '1750 Summerton Street', '2024-11-07', '51', '75', '11', '54', 'Alugado'),
(70, 'Quam deserere ullam officii partem, ad ea, quae senserit ille, tibi non.', 'Ponunt et splendore nominis capti quid natura postulet non intellegunt, errore maximo, si Epicurum audire voluerint, liberabuntur: istae enim vestrae eximiae pulchraeque virtutes nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim aeque doleamus animo, cum corpore dolemus, fieri tamen permagna accessio potest, si aliquod aeternum et infinitum impendere.', '104703.04', '12287 Albatross Avenue', '2024-05-24', '5', '90', '9', '41', 'Disponível'),
(71, 'Quae percipitur omni dolore et molestia perfruique maximis et animi et corporis voluptatibus, videti', 'Etiam approbantibus nobis. Sic enim ab Epicuro scriptum est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus omnes mea legant. Utinam esset ille Persius.', '95216.69', '8309 Omega Street', '2025-02-22', '40', '96', '74', '48', 'Vendido'),
(72, 'Diligant. Quod et scripta multa sunt, sic inprobitas si cuius in mente consedit, hoc ipso, quod ades', 'Sed similia fere dici possunt. Ut enim virtutes, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes bene sanos ad iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt.', '85279.37', '12199 Gaylark Avenue', '2024-11-01', '13', '45', '1', '27', 'Indisponível'),
(73, 'Nec intemperantiam propter se expetendam esse dicemus, sed quia consequuntur magni dolores eos, qui ', 'Has optari, quia voluptatem. Iustitia restat, ut de commodis suis cogitarent? At id ne ferae quidem faciunt, ut ita ruant itaque turbent, ut earum motus et impetus quo pertineant non.', '78582.29', '8953 Gutierrez Place', '2025-02-26', '81', '71', '93', '47', 'Vendido'),
(74, 'Quaeque cernantur, omnia, eumque motum atomorum nullo a principio, sed ex aeterno tempore intellegi ', 'Cum sero sentiunt frustra se aut pecuniae studuisse aut imperiis aut opibus aut gloriae. Nullas enim consequuntur voluptates, quarum potiendi spe inflammati multos labores magnosque susceperant. Ecce autem alii minuti et angusti aut omnia semper desperantes.', '109328.83', '14676 Barrel Loop', '2024-07-14', '76', '78', '12', '69', 'Disponível'),
(75, 'Locos quidem quosdam, si videbitur, transferam, et maxime ab iis, quos modo nominavi, cum inciderit,', 'Ex aeterno tempore intellegi convenire. Epicurus autem, in quibus tam multis tamque variis ab ultima antiquitate repetitis tria vix amicorum paria reperiuntur.', '116522.40', '12061 Cree Court', '2024-06-10', '93', '56', '88', '55', 'Indisponível'),
(76, 'Quidem oderis, ut fere faciunt, qui ab eo nos abducat? Sin laboramus, quis est.', 'Comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in quibus tam multis tamque variis ab ultima antiquitate repetitis tria vix amicorum paria reperiuntur, ut ad Orestem.', '102125.56', '4313 Vandenberg Court', '2024-05-28', '20', '59', '8', '23', 'Alugado'),
(77, 'Nihil sane praeter sedulitatem probarent, omnes mihi Epicuri sententiae satis notae sunt. Atque eos,', 'Dixi, sole ipso illustriora et clariora sunt, si omnia deorsus e regione ferrentur et, ut dixi, ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si.', '114209.85', '10571 Wesley Street', '2025-04-05', '55', '40', '78', '38', 'Indisponível'),
(78, 'Atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque', '--, haec, quae vitam omnem continent, neglegentur? Nam, ut sint.', '97996.47', '1097 Hollyberry Place', '2025-02-07', '70', '41', '46', '52', 'Vendido'),
(79, 'Quod videamus esse finitum. In dialectica autem vestra nullam existimavit esse nec ad melius vivendu', 'Collegi, abest plurimum et, cum stultorum vitam cum sua comparat, magna afficitur voluptate. Dolores autem si qui incurrunt, numquam vim tantam habent, ut non plus voluptatum habeat quam dolorum. Nam et praeterita grate meminit et praesentibus ita potitur, ut animadvertat quanta sint.', '88423.62', '11580 Mindy Place', '2024-07-01', '57', '76', '95', '96', 'Disponível'),
(80, 'Inter principes civitatis, P. Scaevolam M''.que Manilium, ab iisque.', 'Importari putant. Quae autem tanta ex improbis factis ad minuendas.', '104690.67', '824 Scotia Street', '2024-05-19', '16', '18', '16', '74', 'Alugado'),
(81, '--, haec, quae de philosophia litteris mandamus, legere assueverit, iudicabit nulla ad legendum his ', 'Dolore caret, id in voluptate velit esse.', '89273.04', '7628 Dario Court', '2025-02-15', '63', '10', '31', '72', 'Alugado'),
(82, 'Locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus et ab Epicuro s', 'Videtur quibusdam stabilitas amicitiae vacillare, tuentur tamen eum locum seque facile, ut mihi videtur, expediunt. Ut enim mortis metu omnis quietae vitae status perturbatur, et ut succumbere doloribus eosque humili animo inbecilloque ferre miserum est, ob eamque debilitatem animi multi.', '124401.16', '7343 Swansea Terrace', '2025-04-05', '22', '97', '72', '56', 'Indisponível'),
(83, 'Ab eo nos abducat? Sin laboramus, quis est, qui alienae modum statuat industriae? Nam ut.', 'Explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut perspiciatis, unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam eaque ipsa.', '81954.57', '5548 Naples Place', '2025-02-17', '8', '39', '81', '62', 'Disponível'),
(84, 'Deserere ullam officii partem, ad ea, quae sensum moveat, nulla successerit, eoque intellegi potest ', 'Res consilio ipsius et ratione administrari neque maiorem voluptatem ex infinito tempore aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus.', '122524.84', '7143 Furman Loop', '2025-01-25', '86', '51', '75', '37', 'Vendido'),
(85, 'Et conformavit, ut mihi quidem depravare videatur. Ille atomos quas appellat, id est voluptatem et d', 'Voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos conficiuntque.', '112549.23', '7789 Palmetto Drive', '2025-01-18', '72', '89', '4', '11', 'Disponível'),
(86, 'Natura nihil esse maius amicitia, nihil uberius, nihil iucundius. Nec vero quisquam stultus non horu', 'Neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes.', '120343.25', '7185 Endsley Court', '2024-08-27', '94', '33', '37', '44', 'Indisponível'),
(87, 'Fugiat, sed quia consequuntur magni dolores eos, qui ratione voluptatem sequi nesciunt, neque porro ', 'Leniat. Temperantia est enim, quod tibi ita videri necesse est, quid aut.', '119240.43', '14616 Othello Court', '2024-05-19', '41', '19', '19', '99', 'Alugado'),
(88, 'Nos a libidinum impetu et a spe pariendarum voluptatum seiungi non.', 'Nihil oportere exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et horrida, de malis Graecis Latine scripta deterius. Quibus ego assentior, dum.', '79018.51', '10191 Glenarden Path', '2024-10-25', '35', '87', '94', '84', 'Vendido'),
(89, 'Quam Stoici. Illi enim negant esse bonum quicquam nisi nescio quam illam umbram, quod appellant hone', 'Se cohaerescant, ex quo intellegitur.', '101715.07', '2843 Jolene Place', '2024-11-11', '85', '98', '20', '86', 'Vendido'),
(90, 'Ullam corporis suscipit laboriosam, nisi ut aliquid ex ea.', 'Fortasse; tantum enim esse censet, quantus videtur, vel paulo aut.', '88880.35', '7335 Jupiter Way', '2024-12-27', '56', '63', '51', '71', 'Disponível'),
(91, 'Reliquerunt. Sed hoc commune vitium, illae Epicuri propriae ruinae: censet enim eadem illa atomorum,', 'Hac exaudita quasi voce naturae sic.', '121173.88', '888 Oberlin Court', '2024-08-08', '4', '69', '53', '77', 'Indisponível'),
(92, 'Quia iucunditatis vel plurimum afferat. Nam diligi et carum esse iucundum est.', 'Copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; quod vero securi percussit.', '80590.91', '7036 Esbenshade Way', '2024-07-18', '34', '95', '62', '88', 'Alugado'),
(93, 'Nos ea, quae dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed', 'Perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam Epicurei timidiores paulo contra vestra convicia, sed tamen satis acuti, qui verentur ne, si.', '87859.89', '13624 Dorchester Avenue', '2024-09-18', '38', '29', '35', '49', 'Disponível'),
(94, 'Minus ab eo nos abducat? Sin laboramus, quis est, qui dolorem ipsum, quia dolor sit, amet, consectet', 'Corrumpit, quae sequitur sunt tota Democriti, atomi, inane.', '77349.73', '13189 Chester Court', '2024-08-15', '24', '100', '56', '8', 'Vendido'),
(95, 'Vivi, nisi sapienter, honeste iusteque vivatur, nec.', 'Invidi, difficiles, lucifugi, maledici, monstruosi, alii autem etiam amatoriis levitatibus dediti, alii.', '111450.20', '1332 Tia Terrace', '2024-05-01', '43', '47', '27', '85', 'Alugado'),
(96, 'Solida corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deind', 'Dediti, alii petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob.', '120731.03', '1048 Pacific Lane', '2024-05-28', '53', '23', '25', '57', 'Indisponível'),
(97, 'Si ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere.', 'Delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus et ab antiquis, ad arbitrium suum.', '120118.93', '7169 Lewis Lane', '2024-08-25', '6', '61', '43', '5', 'Disponível'),
(98, 'Videatur. Ille atomos quas appellat, id est voluptatem et dolorem. Ad haec et quae fugiamus refert o', 'Adolescens, ei disputationi interesset. Nam cum ad me de virtute misisti. Sed ex eo perciperet corpore voluptatem, aut cum Latinis tertio consulatu conflixisse apud.', '115650.07', '1904 Yuma Place', '2024-10-02', '88', '43', '55', '22', 'Indisponível'),
(99, 'Maiores fuissent, et in conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis cog', 'Et molestiae non recusandae. Itaque earum rerum.', '88375.40', '10634 Inner Circle', '2024-06-15', '60', '84', '42', '19', 'Alugado'),
(100, 'Voluptate. Neque enim disputari sine reprehensione nec.', 'Deterruisset alios a studiis. Quamquam te quidem video minime esse deterritum.', '82759.30', '8650 Wickham Court', '2025-04-19', '12', '58', '60', '25', 'Vendido');
