INSERT INTO `TB_notificacao` (`id_notificacao`, `id_usuario`, `mensagem`, `data_envio`) VALUES
(1, '16', 'Omnis imperitorum intellegaturque ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut omittam pericula, labores, dolorem etiam, quem optimus quisque pro patria et.', '2024-10-09'),
(2, '54', 'Cum didicerimus quid natura postulet non intellegunt, errore maximo, si Epicurum audire voluerint, liberabuntur: istae enim vestrae eximiae.', '2025-04-01'),
(3, '27', 'Et praesentibus ita potitur, ut animadvertat quanta sint ea quamque iucunda, neque pendet ex futuris, sed expectat illa, fruitur praesentibus ab iisque vitiis, quae paulo ante.', '2024-12-07'),
(4, '67', 'Esse animo, quod sit iudicatum. Plerique autem, quod tenere atque servare id, quod maxime placeat, facere possimus, omnis voluptas assumenda.', '2025-01-23'),
(5, '96', 'Qui in ea voluptate velit esse, quam nihil praetermittatur quod vitam adiuvet, quo facilius id, quod maxime placeat.', '2024-08-28'),
(6, '24', 'Iis, quos ego posse iudicare arbitrarer, plura suscepi veritus ne movere hominum.', '2024-07-20'),
(7, '4', 'Postulant in eo, quod sit a dolore corporis praesenti futurove seiunctum. Nec vero quisquam stultus.', '2024-07-31'),
(8, '47', 'Vult, mihi quidem nulli satis eruditi videntur, quibus nostra ignota sunt. An ''Utinam ne in nemore . . .'' nihilo minus legimus quam hoc idem Graecum, quae autem inanes sunt, iis parendum non est. Nihil enim desiderabile concupiscunt, plusque in ipsa iniuria detrimenti est quam in iis corrigere voluit, deteriora fecit. Disserendi.', '2025-01-12'),
(9, '78', 'Vacare omni dolore careret, non modo nullam captet, sed etiam cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo est.', '2024-06-15'),
(10, '1', 'Credo. -- ''Non est igitur voluptas bonum.'' Hoc.', '2025-04-22'),
(11, '33', 'Malum et, quantum possit, a se.', '2025-04-11'),
(12, '55', 'Dissensio, quis alienum putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium videretur, cum.', '2024-09-07'),
(13, '3', 'Intereant cotidie. Quae etsi mihi nullo modo poterimus sensuum iudicia defendere. Quicquid porro animo cernimus, id omne oritur a sensibus; qui si omnes veri erunt, ut Epicuri ratio docet, tum denique poterit aliquid cognosci et percipi. Quos qui tollunt et nihil posse percipi dicunt.', '2024-06-20'),
(14, '32', 'Ad Epicurum. Nam si ea sola voluptas esset, quae quasi saxum Tantalo semper impendet, tum superstitio, qua qui est imbutus quietus.', '2024-10-08'),
(15, '53', 'Ex rebus expetendis, quid fugiat ut extremum malorum? Qua de re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro.', '2025-03-22'),
(16, '36', 'Hostis mi Albucius, hinc inimicus. Sed iure Mucius. Ego autem mirari satis non queo unde hoc.', '2024-11-18'),
(17, '40', 'Exercitation ullamco laboris nisi ut aliquip ex ea commodi consequatur? Quis autem vel eum iure reprehenderit, qui in ea voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa, qui officia deserunt mollitia animi, id est corpora individua propter soliditatem, censet in infinito inani, in quo a nobis.', '2024-05-03'),
(18, '9', 'Simulent, et iis quidem non admodum indoctis, totum hoc displicet philosophari. Quidam autem non tam solido quam splendido nomine, virtutem autem nixam hoc honesto nullam requirere voluptatem atque ad beate vivendum sapientia comparaverit, nihil esse prosperum.', '2024-11-24'),
(19, '6', 'Imperiis aut opibus aut gloriae. Nullas enim consequuntur voluptates, quarum potiendi spe inflammati multos labores magnosque susceperant. Ecce autem alii minuti et angusti aut omnia semper desperantes aut.', '2025-02-11'),
(20, '63', 'Ita dicam, et ad usus civium non inutile, nosque ea scripta reliquaque eiusdem generis.', '2024-08-18'),
(21, '84', 'Gravis et doctus adolescens, ei disputationi interesset. Nam cum ad te ne.', '2024-06-24'),
(22, '83', 'Ineruditus, sed ii indocti, qui, quae pueros non didicisse turpe est, ea putant usque ad senectutem esse discenda. Quae cum tota res (est) ficta pueriliter, tum ne efficit quidem, quod.', '2025-03-16'),
(23, '81', 'Vivere. Huic certae stabilique sententiae quae sint coniuncta explicabo brevi. Nullus in ipsis error est finibus bonorum et malorum, id est incorruptis atque integris testibus, si infantes pueri, mutae etiam bestiae paene loquuntur magistra ac duce.', '2025-04-29'),
(24, '86', 'Acri animo et corpore voluptatibus nullo dolore nec impediente nec inpendente, quem tandem hoc.', '2024-07-23'),
(25, '18', 'Minus animus a se repellere, idque facere nondum depravatum ipsa.', '2024-09-21'),
(26, '57', 'Est, ea putant usque ad senectutem esse discenda. Quae cum tota res (est) ficta pueriliter, tum ne efficit quidem, quod vult. Nam et complectitur.', '2025-03-16'),
(27, '91', 'Triari, nullo pacto potest, ut propemodum iustioribus utamur illis, qui omnino.', '2025-04-01'),
(28, '87', 'Occulte fecerit, numquam tamen id volunt.', '2024-09-11'),
(29, '89', 'Democriti errata ab Epicuro scriptum est et ab Epicuro sapiens semper beatus inducitur: finitas habet cupiditates, neglegit mortem, de diis inmortalibus sine ullo metu vera sentit, non dubitat.', '2025-02-28'),
(30, '23', 'Sequamur monet. Nec enim satis est iudicare.', '2024-10-29'),
(31, '100', 'Eo et gravissimas res consilio ipsius et ratione administrari neque maiorem voluptatem.', '2024-05-10'),
(32, '10', 'Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici.', '2025-03-28'),
(33, '37', 'Cognitione et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum. Sic e.', '2024-07-11'),
(34, '50', 'Id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque.', '2024-05-31'),
(35, '65', 'Leniat. Temperantia est enim, quod tibi parum videtur eruditus, ea causa est, quod nullam eruditionem esse duxit, nisi quae beatae vitae disciplinam iuvaret. An ille tempus aut in dolore, sed.', '2024-08-14'),
(36, '19', 'Nulla pariatur? At vero eos et accusamus et iusto odio dignissimos ducimus, qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores et quas molestias excepturi sint.', '2025-03-11'),
(37, '51', 'Sed in his rebus instructus semper est in quo nihil posset fieri minus; ita effici complexiones et copulationes et adhaesiones atomorum inter se, ex quo intellegitur nec timiditatem ignaviamque vituperari nec fortitudinem patientiamque laudari suo nomine, sed illas reici, quia dolorem pariant, has optari, quia voluptatem. Iustitia restat, ut de utilitatibus, nihil.', '2024-08-02'),
(38, '15', 'Eae se foris solum iactant nec tantum in alios caeco impetu incurrunt, sed intus etiam in animis nostris inesse notionem, ut alterum esse appetendum, alterum aspernandum sentiamus. Alii autem, quibus ego assentior, dum modo de isdem rebus ne Graecos quidem.', '2024-08-16'),
(39, '98', 'Dirigentur, numquam ullius oratione victi sententia desistemus. Nisi autem rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum, quae vis sit, quae quidque efficiat, de materia.', '2024-05-14'),
(40, '99', 'Aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam.', '2025-01-30'),
(41, '58', 'Quam utramque Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel optime scripserit Electram, tamen male conversam Atilii mihi legendam putem, de quo quaerimus, non quo modo.', '2024-07-20'),
(42, '7', 'Instructus semper est in voluptate. Neque enim tempus est ullum, quo non plus habeat sapiens, quod gaudeat, quam quod angatur. Optime vero Epicurus, quod exiguam dixit fortunam intervenire.', '2025-03-23'),
(43, '85', 'Commodo consequat. Duis aute irure dolor in reprehenderit in voluptate.', '2024-08-07'),
(44, '17', 'Suavitate afflueret et illaberetur, nec manus esse contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est, ut.', '2024-09-18'),
(45, '8', 'Ex infinito tempore aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et corpore voluptatibus nullo dolore nec impediente nec inpendente, quem tandem hoc statu.', '2024-12-02'),
(46, '39', 'O praeclaram beate vivendi et apertam et simplicem et directam viam! Cum enim certe nihil homini possit melius esse quam.', '2025-03-29'),
(47, '28', 'Id meo arbitratu facerem, ante hoc tempus numquam est esse expetendam et insipientiam propter molestias esse fugiendam? Eademque ratione ne temperantiam quidem propter se ipsos diligant. Quod et scripta multa sunt, sic inprobitas si cuius in animo versatur, numquam sinit.', '2025-04-25'),
(48, '95', 'Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel optime scripserit Electram, tamen male conversam Atilii mihi legendam putem, de quo Lucilius: ''ferreum.', '2024-10-08'),
(49, '59', 'Valetudinis causa probamus, et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non expeteretur, si nihil tale metuamus.', '2024-08-10'),
(50, '48', 'Individua et solida corpora ferri deorsum suo pondere ad.', '2024-05-16'),
(51, '38', 'Nisi derigatur ad voluptatem, voluptas autem est sola, quae nos vocet ad se et alliciat suapte natura, non potest esse dubium, quin id sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate vivere. Nec.', '2025-04-12'),
(52, '73', 'Ille bene noris. Nisi mihi Phaedrum, inquam, tu mentitum aut Zenonem putas, quorum utrumque audivi, cum mihi nihil sane praeter sedulitatem probarent, omnes mihi.', '2024-07-01'),
(53, '22', 'Una virtute ponunt et splendore nominis capti quid natura postulet non intellegunt, errore maximo, si Epicurum audire voluerint, liberabuntur: istae.', '2024-06-26'),
(54, '79', 'Contra vestra convicia, sed tamen satis acuti, qui verentur ne, si amicitiam propter nostram voluptatem expetendam putemus, tota amicitia quasi claudicare videatur.', '2024-10-03'),
(55, '61', 'Vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam.', '2024-11-14'),
(56, '43', 'Civium non inutile, nosque ea scripta reliquaque eiusdem generis et.', '2025-03-07'),
(57, '30', 'Ex aeterno tempore intellegi convenire. Epicurus autem, in quibus sequitur Democritum, non fere labitur. Quamquam utriusque cum multa non probo, tum illud in primis, quod, cum in rerum.', '2024-11-12'),
(58, '12', 'Facilius fieri poterit et iustius? Sunt autem, qui dicant.', '2025-04-25'),
(59, '94', 'Graece ergo praetor Athenis, id quod maluisti, te, cum ad.', '2024-10-01'),
(60, '20', 'Quam nati, et ad eos cum suavitate afflueret et.', '2025-01-29'),
(61, '45', 'Occultum. Plerumque improborum facta primo suspicio insequitur, dein sermo atque fama, tum accusator, tum iudex.', '2024-07-18'),
(62, '62', 'Id neque feci adhuc nec mihi tamen, ne faciam, interdictum puto. Locos quidem quosdam, si videbitur, transferam, et maxime ab iis, quos ego posse iudicare arbitrarer, plura suscepi.', '2024-10-07'),
(63, '13', 'Sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut.', '2024-10-19'),
(64, '34', 'Hoc Epicurus in voluptate esse aut in.', '2025-03-18'),
(65, '2', 'Ob ea solum incommoda, quae eveniunt inprobis, fugiendam inprobitatem putamus, sed multo etiam magis, quod, cuius in animo.', '2024-05-13'),
(66, '74', 'Quae vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae nos a.', '2025-01-03'),
(67, '77', 'Mi Albucius, hinc inimicus. Sed iure Mucius. Ego.', '2024-11-27'),
(68, '88', 'Ut vulgo putarent, sed locupletiorem etiam esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis aut poetis, postea quidem quam fuit quem imitarentur, ullus orationis vel copiosae vel elegantis ornatus defuit? Ego vero, quoniam.', '2025-01-09'),
(69, '44', 'Nullas enim consequuntur voluptates, quarum potiendi spe inflammati multos labores magnosque susceperant. Ecce autem.', '2025-01-07'),
(70, '31', 'Ea scientia et verborum vis et natura orationis et consequentium repugnantiumve ratio potest perspici. Omnium autem rerum natura.', '2024-08-28'),
(71, '82', 'Concursionibus inter se cohaerescant, ex quo efficeretur mundus omnesque partes mundi, quaeque in eo essent. Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens.', '2024-10-23'),
(72, '21', 'Incorrupte atque integre iudicante. Itaque negat opus esse ratione neque disputatione, quam ob rem dissentientium inter.', '2025-03-03'),
(73, '71', 'At id ne ferae quidem faciunt, ut ita ruant itaque turbent, ut earum motus et impetus quo pertineant non intellegamus, tu tam egregios viros censes tantas res gessisse sine causa? Quae fuerit causa, mox videro; interea hoc tenebo, si ob aliquam causam.', '2024-07-31'),
(74, '56', 'Id autem res referuntur omnes, fatendum est summum esse bonum iucunde vivere. Id qui in una virtute ponunt et splendore nominis capti quid natura desideret. Tum vero, si stabilem scientiam rerum tenebimus, servata illa, quae quasi saxum Tantalo semper impendet, tum superstitio.', '2024-11-13'),
(75, '92', 'Facilis est et ad corpus nihil referatur, ista sua sponte et per se esse fugiendum. Itaque aiunt hanc quasi naturalem atque insitam in animis.', '2024-06-02'),
(76, '5', 'In morbos gravis, tum in damna, tum in morbos gravis, tum in dedecora incurrunt, saepe etiam legum iudiciorumque poenis obligantur. Qui autem alia malunt scribi a nobis, aequi esse debent, quod et acutum genus est et expedita distinctio. Nam libero tempore, cum.', '2025-03-02'),
(77, '11', 'Praesens et quod adest sentire possumus.', '2024-06-23'),
(78, '41', 'Rectas res atque laudabilis eo referri, ut cum voluptate vivere. Huic certae stabilique sententiae quae sint quaeque cernantur, omnia, eumque motum atomorum nullo a principio, sed ex aeterno tempore intellegi convenire. Epicurus autem, in quibus nulla.', '2025-03-06'),
(79, '49', 'Quaerendi ac disserendi, quae logikh dicitur, iste vester plane, ut mihi videtur, expediunt. Ut enim ad sapientiam perveniri potest, non paranda nobis solum ea, sed fruenda etiam sapientia est; sive hoc difficile est, tamen nec modus ullus nec finis inveniri potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam.', '2024-07-07'),
(80, '76', 'Sint neque sint conversa de Graecis? Nam si concederetur, etiamsi ad corpus referri.', '2025-03-31'),
(81, '69', 'Noster Lucilius, recusabo, quo minus omnes mea legant. Utinam esset ille Persius, Scipio vero.', '2025-03-13'),
(82, '80', 'Recusabo, quo minus animus a se ipse dissidens secumque discordans gustare partem ullam liquidae voluptatis et liberae potest. Atqui pugnantibus.', '2024-10-06'),
(83, '93', 'Fieri minus; ita effici complexiones et copulationes et adhaesiones atomorum inter se, ex quo efficeretur mundus omnesque partes mundi, quaeque in eo filio adhibuit.', '2024-11-05'),
(84, '60', 'Nullo modo probantur, tamen Democritum laudatum a ceteris ab hoc, qui eum unum secutus esset, nollem vituperatum. Iam in altera philosophiae parte. Quae est quaerendi ac disserendi, quae.', '2025-02-22'),
(85, '52', 'Modo quae dicat ille bene noris. Nisi mihi Phaedrum, inquam, tu mentitum aut Zenonem putas, quorum utrumque audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amatoriis levitatibus dediti, alii.', '2024-07-10'),
(86, '75', 'Sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam e nostris, qui haec subtilius velint tradere et negent satis esse, quid bonum sit aut quid malum, sensu iudicari, sed animo etiam ac ratione intellegi posse et voluptatem pleniorem efficit. Itaque non ob.', '2025-01-02'),
(87, '97', 'Est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet, ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut voluptates omittantur maiorum voluptatum adipiscendarum causa aut dolores suscipiantur maiorum dolorum effugiendorum gratia. Sed de clarorum hominum.', '2024-09-02'),
(88, '70', 'Horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, quod huc possit, quod conetur, nec optinere, si effecerit, et opes vel fortunae vel ingenii liberalitati magis conveniunt, qua qui utuntur, benivolentiam sibi conciliant et, quod aptissimum.', '2025-01-03'),
(89, '25', 'Non satis politus iis artibus, quas qui tenent, eruditi appellantur -- aut ne deterruisset alios a studiis. Quamquam te quidem video esse a nostris de amicitia disputatum. Alii cum eas voluptates, quae ad.', '2024-08-30'),
(90, '72', 'Non placebit Latine? Quid? Si nos non interpretum fungimur munere, sed tuemur ea, quae hoc non minus declarant, sed videntur leviora, veniamus. Quid tibi, Torquate, quid huic Triario litterae, quid.', '2025-01-10'),
(91, '14', 'Est usus Epicurus? Qui unum genus posuit earum cupiditatum, quae essent et naturales et necessariae, alterum, quae vis sit, quae quidque efficiat, de materia disseruerunt, vim et causam efficiendi reliquerunt. Sed hoc.', '2025-01-22'),
(92, '64', 'Mundi, qui et oriantur et intereant cotidie. Quae etsi mihi.', '2024-05-25'),
(93, '42', 'Non talem videri fuisse in imperio, quales eius maiores fuissent, et in conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis.', '2024-05-28'),
(94, '68', 'Eaque ipsa, quae tibi probarentur; si qua in iis corrigere voluit, deteriora fecit. Disserendi artem nullam habuit. Voluptatem cum summum bonum esse vult, summumque malum dolorem, idque instituit docere sic: Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem aspernari ut summum malum et, quantum possit, a.', '2024-10-21'),
(95, '46', 'Facile efficere possit, quod melius sit, accedere? Statue contra aliquem confectum tantis animi corporisque.', '2024-08-18'),
(96, '66', 'Provincias atomis dare, quae recte, quae oblique ferantur, deinde eadem illa constituto veri a falso distinctio traditur. Restat locus huic disputationi vel maxime necessarius de amicitia, quam, si voluptas esset bonum, desideraret.', '2024-11-07'),
(97, '35', 'Bello animadversionis metu contineret, saluti prospexit civium, qua intellegebat contineri suam. Atque haec ratio late patet. In quo enim maxime.', '2024-05-07'),
(98, '26', 'Suscipiantur maiorum dolorum effugiendorum gratia. Sed de clarorum hominum factis illustribus et gloriosis satis.', '2025-02-09'),
(99, '90', 'Comprehenderit, ut omnes bene sanos ad iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile efficere possit, quod conetur, nec optinere, si.', '2025-04-15'),
(100, '29', 'Qua de re cum sit inter doctissimos summa dissensio, quis alienum.', '2024-12-22');
