INSERT INTO `TB_regiao` (`id_regiao`, `nome`) VALUES
(1, 'Quaeso, interpretaris? Sicine eos censes aut in poetis evolvendis, ut ego et Triarius te hortatore f'),
(2, 'Comparat, magna afficitur voluptate. Dolores autem si qui e.'),
(3, 'Perdiderunt, sic robustus animus et excelsus omni est liber cura et angore, cum et mortem contemnit,'),
(4, 'Non modo numquam nocet cuiquam, sed contra semper afficit cum vi sua atque natura, quod tranquillat '),
(5, 'Ipse dissidens secumque discordans gustare partem ullam liquidae voluptatis et liberae potest. Atqui'),
(6, 'Verbum e Graecis expressas non inviti legant. Quis enim tam inimicus paene.'),
(7, 'Zenonem putas, quorum utrumque audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amar'),
(8, 'Dolore suo sanciret militaris imperii disciplinam exercitumque in gravissimo bello animadversionis m'),
(9, 'Me accedis, saluto: ''chaere,'' inquam, ''Tite!'' lictores.'),
(10, 'Deserunt mollit anim id est propter voluptatem et dolorem. Ad haec et quae vel aliter pararetur et q'),
(11, 'Neque vero ipsam amicitiam tueri, nisi aeque amicos et nosmet ipsos diligamus, idcirco et hoc ipsum '),
(12, 'Omnium rerum occultarum ignoratione sublata et moderatio natura cupiditatum generibusque earum expli'),
(13, 'Contra metum religionis et sedatio animi omnium rerum.'),
(14, 'Posse a voluptate discedere. Nam cum solitudo et vita sine amicis insidiarum et metus plena sit, rat'),
(15, 'Litteris uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem ita frui volunt v'),
(16, 'Ulla iniuria, quae autem tanta ex improbis factis ad minuendas vitae.'),
(17, 'De voluptate et dolore magnam aliquam quaerat voluptatem. Ut enim virtutes, de quibus et ab antiquis'),
(18, 'Hoc ita defendit Epicurus neque Metrodorus aut quisquam eorum, qui aut saperet aliquid aut ista didi'),
(19, 'Quidem depravare videatur. Ille atomos quas appellat, id est voluptatem.'),
(20, 'Non dolere. Sed ut omittam pericula, labores, dolorem etiam, quem optimus quisque pro patria et pro '),
(21, 'Sed expectat illa, fruitur praesentibus ab iisque M. Brutus dissentiet -- quod et posse fieri intell'),
(22, 'Causa? Quae fuerit causa, mox videro; interea hoc tenebo, si ob aliquam causam ista, quae sine dubio'),
(23, 'Appareat, doctrina mediocris. Ego autem quem timeam lectorem, cum ad me accedis, saluto: ''chaere,'' i'),
(24, 'Tamen permagna accessio potest, si aliquod aeternum et infinitum.'),
(25, 'Amputata circumcisaque inanitate omni et errore naturae finibus contentus sine aegritudine possit et'),
(26, 'Si amicitiam propter nostram voluptatem expetendam putemus, tota amicitia quasi claudicare videatur.'),
(27, 'Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid.'),
(28, 'Malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur, inq'),
(29, 'Occultarum ignoratione sublata et moderatio natura cupiditatum generibusque earum explicatis, et, ut'),
(30, 'Ante collegi, abest plurimum et, cum stultorum vitam cum sua comparat, magna afficitur voluptate. Do'),
(31, 'Sic in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium ess'),
(32, 'Aliquid, praeter voluptatem et dolorem? Sunt autem quidam Epicurei timidiores paulo contra vestra co'),
(33, 'Ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem angusta, quam ma'),
(34, 'Et operosam et perinde fructuosam relinqueret? Non ergo.'),
(35, 'In primisque familiarem nostrum Posidonium. Quid? Theophrastus mediocriterne delectat, cum tractat l'),
(36, 'Sint et molestiae non recusandae. Itaque earum rerum defuturum, quas natura non depravata desiderat.'),
(37, 'Democriti, atomi, inane, imagines, quae eidola nominant, quorum incursione non solum videamus, sed e'),
(38, 'Quod exiguam dixit fortunam intervenire sapienti maximasque ab eo nos abducat? Sin laboramus, quis e'),
(39, 'Quantum potuimus, non modo non repugnantibus, verum etiam approbantibus nobis. Sic enim ab Epicuro s'),
(40, 'Sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe'),
(41, 'Sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio be'),
(42, 'Munere vitae optimum et verissimum sit, exquirere? An, partus ancillae.'),
(43, 'Intemperantiam propter se expetendam esse dicemus, sed quia maiores consequatur. Eadem fortitudinis '),
(44, 'Dicemus, sed quia iucunditatis vel plurimum afferat. Nam diligi et carum esse.'),
(45, 'Iam videtis, ne invidia verbi labefactetur oratio mea --. Nam cum solitudo et vita sine amicis insid'),
(46, 'Laboris nisi ut aliquid ex ea commodo consequat. Duis aute irure dolor in longinquitate levis, in gr'),
(47, 'Plane Graecum dici velit, ut a Scaevola est praetore salutatus Athenis Albucius. Quem quidem locum c'),
(48, 'Ut, etiamsi nulla sit utilitas ex amicitia, tamen ipsi amici propter se esse fugiendum. Itaque aiunt'),
(49, 'De quo quaerimus, non quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus ig'),
(50, 'Alios caeco impetu incurrunt, sed intus etiam in animis nostris inesse notionem, ut alterum esse app'),
(51, 'Isdem rebus ne Graecos quidem legendos putent. Res vero bonas verbis electis graviter ornateque dict'),
(52, 'Legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabul'),
(53, 'Tam multos legant, quam legendi sunt. Quid enim est a Chrysippo praetermissum in Stoicis? Legimus ta'),
(54, 'Nec inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse e'),
(55, 'Maxime hoc placeat, moderatius tamen id volunt fieri, difficilem quandam temperantiam postulant in e'),
(56, 'Praeterea sublata cognitione et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum.'),
(57, 'Ipsarum quidem virtutum laus, in qua maxime ceterorum philosophorum exultat oratio, reperire exitum '),
(58, 'Contrariis studiis consiliisque semper utens nihil quieti videre, nihil tranquilli potest. Quodsi co'),
(59, 'Eos, quos nominavi, cum Attico nostro frequenter audivi, cum mihi nihil.'),
(60, 'Quae sint, ea facere ipsa per se ipsam optabilem, sed quia non numquam eius modi esse.'),
(61, 'Multa habere intervalla requietis, mediocrium nos esse dominos, ut, si tolerabiles sint, feramus, si'),
(62, 'Moderatio natura cupiditatum generibusque earum explicatis, et, ut dixi, ad lineam.'),
(63, 'Dolere, primum tibi recte, Chrysippe, concessum est nihil desiderare manum, cum ita sit, perspicuum '),
(64, 'In physicis nec ea ipsa, quae laudatur, industria, ne fortitudo quidem, sed ista sequimur.'),
(65, 'Sit tam insolens domesticarum rerum fastidium. Non est omnino hic docendi locus; sed ita sentio.'),
(66, 'Tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posi'),
(67, 'Reprehensa et correcta permulta. Nunc dicam de voluptate, a.'),
(68, 'Malum nobis opinemur. Quod idem licet transferre in voluptatem, ut postea variari voluptas distingui'),
(69, 'Plerumque improborum facta primo suspicio insequitur, dein sermo atque fama, tum accusator, tum iude'),
(70, 'Quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini.'),
(71, 'Nihil homine videatur indignius. Ad maiora enim quaedam nos natura genuit et conformavit, ut mihi qu'),
(72, 'Perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae audiebamus,'),
(73, 'Civitas in seditione beata esse potest nec in discordia dominorum domus; quo minus animus a se repel'),
(74, 'Igitur, inquit, sic agam, ut ipsi auctori huius disciplinae placet: constituam, quid et quale sit id'),
(75, 'Atque integre iudicante. Itaque negat opus esse ratione neque disputatione, quam ob rem tandem, inqu'),
(76, 'Movere hominum studia viderer, retinere non posse. Qui autem, si maxime hoc placeat, moderatius tame'),
(77, 'Enim habet nostra mens quicquam, ubi consistat tamquam in extremo, omnesque et metus et.'),
(78, 'Ac leniat. Temperantia est enim, quae in rebus aut expetendis aut fugiendis ut rationem sequamur mon'),
(79, 'Recte, si voluptas esset bonum, fuisse desideraturam. Idcirco enim non desideraret, quia, quod dolor'),
(80, 'Reprehensione nec cum istis tantopere pugnare, qui Graeca legere malint, modo legant illa ipsa, ne s'),
(81, 'Amatoriis levitatibus dediti, alii petulantes.'),
(82, 'Modo dixi, constituto, ut aut voluptates omittantur.'),
(83, 'Ratio bene sanos in viam placatae, tranquillae, quietae, beatae vitae deduceret? Qui quod tibi ita v'),
(84, 'Voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e patre audieba'),
(85, 'Atque servare id, quod propositum est, summum bonum consequamur? Clamat Epicurus, is quem vos nimis '),
(86, 'Nec segniorem ad respondendum reddidisti.'),
(87, 'Extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate conectitur. Nam et laeta'),
(88, 'Necesse est, quid aut ad bene beateque vivendo a Platone disputata sunt, haec explicari non placebit'),
(89, 'Ea scientia et verborum vis et natura orationis et consequentium repugnantiumve ratio potest perspic'),
(90, 'Maior sit, mediocritatem desiderent. Sive enim ad minim veniam, quis nostrud exercitation ullamco la'),
(91, 'Solido quam splendido nomine, virtutem autem nixam hoc honesto nullam requirere voluptatem atque ad '),
(92, 'Ante dictum est, sic amicitiam negant posse a voluptate aut a voluptate discedere. Nam cum ignoratio'),
(93, 'In quibus, quantum potuimus, non modo voluptatem esse, verum etiam approbantibus nobis. Sic enim ab '),
(94, 'Denique'' -- non enim illum ab industria, sed ab.'),
(95, 'Quibus non solum praesentibus fruuntur, sed etiam effectrices sunt voluptatum tam amicis.'),
(96, 'Caret, id in hominum consuetudine facilius fieri poterit.'),
(97, 'Quae quia certa esse non possunt, conficiuntur et angore et metu maximeque cruciantur, cum sero sent'),
(98, 'Industria, ne fortitudo quidem, sed ista sequimur.'),
(99, 'Esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia deorsus e regio'),
(100, 'Omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa q');
