INSERT INTO `TB_USUARIO` (`id_usuario`, `nome`, `email`, `telefone`, `tipo`) VALUES
(1, 'Possent sine dolore tum in dedecora incurrunt, saepe etiam videmus, et perspicuum est nihil ad Epicu', 'De vita. His rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem voluptates et dolore', 'Quiddam inter dolore', 'Vendedor'),
(2, 'Probamus, eisque nostrum iudicium et nostrum scribendi ordinem adiungimus, quid habent, cur Graeca a', 'Inutile, nosque ea scripta reliquaque eiusdem generis et legimus libenter et legemus --, haec, quae ', 'Videtur, vel paulo a', 'Comprador'),
(3, 'Videtur, inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo docet, non quo m', 'Id confidet fore semper occultum. Plerumque improborum facta primo suspicio insequitur, dein.', 'Sapientes bona praet', 'Locador'),
(4, 'Ne id ipsum quidem expedire possunt, quod disserunt. Praeterea sublata cognitione et scientia tollit', 'Voluptatem ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem', 'Latinas ad verbum e ', 'Corretor'),
(5, 'E regione inferiorem locum petentium sine causa dicere, -- et illum motum naturalem omnium ponderum,', 'Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem asperna', 'Vero molita quippiam', 'Comprador'),
(6, 'Est omnino hic docendi locus; sed ita sentio et saepe etiam videmus, et perspicuum est omnis rectas ', 'Iis quidem non admodum indoctis, totum hoc displicet philosophari. Quidam autem non tam solido quam ', 'Atque discordant, ex', 'Vendedor'),
(7, 'P. Scaevolam M''.que Manilium, ab iisque vitiis, quae paulo ante cum memoriter, tum etiam erga nos am', 'Et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum. Sic e physicis et fortitudo ', 'In gravissimo bello ', 'Corretor'),
(8, 'Ab illo, recta et honesta.', 'Non quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus igitur, quid sit ext', 'Sed ut ratione et vi', 'Locador'),
(9, 'Comparandae voluptatis -- Quam autem ego dicam voluptatem, iam videtis, ne invidia verbi labefactetu', 'Sit, sed stare etiam oportet in eo, quod semel admissum coerceri reprimique.', 'Recte nominata est v', 'Vendedor'),
(10, 'Factis illustribus et gloriosis satis hoc loco dictum sit. Erit.', 'Tractatos? Quid? Epicurei num desistunt de isdem, de quibus ante dictum est, sic amicitiam negant po', 'Ratione administrari', 'Corretor'),
(11, 'Is quidem, sicut alia; sed neque tam docti tum erant, ad quorum iudicium elaboraret, et sunt illius ', 'Commodis suis cogitarent? At id ne ferae quidem faciunt.', 'Meam, et eo quidem c', 'Locador'),
(12, 'Verear, ne ad eam non possim accommodare Torquatos nostros? Quos tu paulo ante cum memoriter, tum et', 'Hoc honesto nullam requirere voluptatem atque ad beate vivendum sapientia comparaverit, nihil esse m', 'Ipsas sollicitudines', 'Comprador'),
(13, 'Homines optimi non intellegunt totam rationem everti, si ita res se habeat. Nam si concederetur, eti', 'Quibus rebus intellegitur nec timiditatem ignaviamque vituperari nec fortitudinem patientiamque laud', 'Vel ingenii liberali', 'Locador'),
(14, 'Beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non inte', 'Fugiendam? Eademque ratione ne temperantiam quidem.', 'Probatum sit, sublat', 'Vendedor'),
(15, 'Ipsa iniuria detrimenti est quam in iis rebus emolumenti, quae pariuntur iniuria. Itaque ne iustitia', 'Ante quam nati, et ad.', 'Diogenem, Antipatrum', 'Corretor'),
(16, 'Gravis, tum in damna, tum in dedecora incurrunt, saepe etiam legum iudiciorumque poenis.', 'Sicut alia; sed neque tam docti tum erant, ad quorum iudicium elaboraret, et sunt illius.', 'Animi autem morbi su', 'Comprador'),
(17, 'Intellegunt totam rationem everti, si ita.', 'In mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis occult', 'Oratio me istius phi', 'Comprador'),
(18, 'Quod vult. Nam et ipsa declinatio ad libidinem fingitur -- ait enim declinare atomum sine causa; quo', 'Etiam in animis nostris inesse notionem, ut alterum esse appetendum, alterum aspernandum sentiamus. ', 'Tamen id volunt fier', 'Vendedor'),
(19, 'Intellegi convenire. Epicurus autem, in quibus sequitur Democritum, non fere labitur. Quamquam utriu', 'Ego autem quem timeam lectorem, cum ad me de virtute misisti. Sed ex.', 'Ut cum voluptate viv', 'Corretor'),
(20, 'Minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquid ex ea commodi consequatur? Q', 'Optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter', 'Certe, inquam, perti', 'Locador'),
(21, 'Mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis occulte f', 'Rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem morbi sunt cupiditates inmensae e', 'Tum accusator, tum i', 'Locador'),
(22, 'Levamur superstitione, liberamur mortis metu, non conturbamur.', 'Etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos conficiuntque curis', 'Quid aut ad naturam ', 'Comprador'),
(23, 'Aut magis expetendum possimus dicere? Inesse enim necesse est aut in dolore, sed in his rebus peccan', 'Meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interess', 'Reperiri posse, quod', 'Vendedor'),
(24, 'Disciplina, quam gravis, quam continens, quam severa sit. Non enim hanc solam sequimur, quae suavita', 'Quodsi vita doloribus referta maxime fugienda est, summum bonum consequamur? Clamat Epicurus, is que', 'Voluptas expetenda, ', 'Corretor'),
(25, 'Certe nihil homini possit melius esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus boni', 'Dolorem timentis, quod mors sensu careat, dolor in longinquitate levis, in gravitate brevis soleat e', 'Non emolumento aliqu', 'Corretor'),
(26, 'Insidiarum et metus et aegritudines ad dolorem referuntur, nec praeterea est res ulla, quae sua natu', 'Aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel ', 'Octavio fuit, cum il', 'Comprador'),
(27, 'Aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmi', 'Aegritudines, molestiae, maerores, qui exedunt animos conficiuntque curis hominum non intellegentium', 'Veniamus. Quid tibi,', 'Locador'),
(28, 'Agam, ut ipsi auctori huius disciplinae placet: constituam, quid et quale sit id.', 'Uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem ita frui volunt voluptatib', 'E regione ferrentur ', 'Vendedor'),
(29, 'Offendit; nam et praeterita grate meminit et praesentibus ita potitur, ut animadvertat quanta sint.', 'Fugiamus refert omnia. Quod quamquam Aristippi est a Chrysippo praetermissum in Stoicis? Legimus tam', 'Doloribus asperiores', 'Corretor'),
(30, 'Mihi libro, quem ad modum, quaeso, interpretaris?', 'Primum totus est alienus. Democritea dicit perpauca mutans, sed ita, ut ea.', 'Assumenda est, omnis', 'Locador'),
(31, 'Quoniam autem id est voluptatem. Homines optimi non intellegunt totam rationem everti, si ita res se', 'Torquate. Oratio me istius philosophi non offendit; nam et praeterita et futura. Ut enim ad minim ve', 'Nihil iucundius. Nec', 'Comprador'),
(32, 'Ante dictum est, sic amicitiam negant posse a voluptate aut a dolore. Quod cum ita sit, perspicuum e', 'Occultum. Plerumque improborum facta primo suspicio insequitur, dein sermo atque fama, tum accusator', 'Videntur, deorum tam', 'Vendedor'),
(33, 'Probamus, et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte.', 'Optio, cumque nihil impedit, quo minus id, quod his libris quaeritur, qui sit.', 'Sint coniuncta expli', 'Comprador'),
(34, 'Se ipsum, quosque labores propter suam voluptatem susciperet, eosdem suscipiet propter amici.', 'Voluptate ponit, quod summum bonum esse.', 'Concessum est nihil ', 'Locador'),
(35, 'Rationem sequamur monet. Nec enim habet nostra mens quicquam, ubi consistat tamquam in extremo, omne', 'Quod ista Platonis, Aristoteli, Theophrasti orationis ornamenta neglexerit. Nam illud quidem adduci ', 'Terentii quam utramq', 'Vendedor'),
(36, 'Ut te consule, ipsi se indicaverunt. Quodsi qui satis sibi.', 'Addidisti ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut errem, se', 'Homero Ennius, Afran', 'Corretor'),
(37, 'Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque maximam', 'Cur dubitemus dicere et sapientiam propter voluptates expetendam et dolorem ipsum per se ipsas tam e', 'Si canes, si equos, ', 'Vendedor'),
(38, 'Atomi declinabunt, nullae umquam cohaerescent, sive aliae declinabunt, aliae.', 'Quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus igitur, quid.', 'Cognoscerem, quoniam', 'Corretor'),
(39, 'Metus plena sit, ratio ipsa.', 'Et parvam et non necessariam et quae vel aliter pararetur et qua etiam carere possent sine dolore tu', 'Domesticarum rerum f', 'Locador'),
(40, 'Eaque gaudere ut summo bono, dolorem aspernari ut summum malum et, quantum possit, a se ipse disside', 'Nulli propter eas consequantur dolores, et qui suum iudicium retinent, ne voluptate.', 'Inquit, modo ista si', 'Comprador'),
(41, 'Sit extremum et ultimum bonorum, quod omnium philosophorum sententia tale debet esse, ut eius magnit', 'Gloriae, dominationis, libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, q', 'Hinc hostis mi Albuc', 'Corretor'),
(42, 'Possumus. Quam ob rem dissentientium.', 'Ignaviamque vituperari nec fortitudinem patientiamque laudari suo nomine, sed illas reici, quia dolo', 'Poterit aliquid cogn', 'Comprador'),
(43, 'Difficilius satis facere, qui se dicant in Graecis legendis operam malle consumere. Postremo aliquos', 'In varias reprehensiones incurreret. Nam quibusdam, et iis servire, qui vel utrisque litteris uti ve', 'Esse expetendam et i', 'Locador'),
(44, 'Et ortum esse e corpore et ad usus civium non inutile, nosque ea scripta reliquaque eiusdem generis ', 'Inquam, Triari, nullo pacto potest, ut propemodum iustioribus utamur illis, qui omnino avocent.', 'Consectetur adipisci', 'Vendedor'),
(45, 'Et quae fugiamus refert omnia. Quod quamquam Aristippi est a Chrysippo praetermissum in.', 'Uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus e', 'Quidem quam fuit que', 'Comprador'),
(46, 'Cum id, quod ipsi statuerunt, non possunt, victi et debilitati obiecta.', 'Et gloriosis satis hoc loco dictum.', 'Animis afferat et eo', 'Corretor'),
(47, 'Eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu vivere. Quae est enim contra Cy', 'Finiri, parvos multa habere intervalla.', 'In corpore. Non plac', 'Vendedor'),
(48, 'Teneam sententiam, quid est enim contra Cyrenaicos satis acute, nihil ad iucunde vivendum reperiri p', 'Magnopere desiderent. Qui autem ita frui volunt voluptatibus, ut nulli propter eas consequantur dolo', 'Tot versuum memoria ', 'Locador'),
(49, 'Concursionibus inter se cohaerescant, ex quo efficiantur ea, quae dixi, sole ipso illustriora et cla', 'Tibique, si mihi probabis ea, quae praeterierunt, acri animo et.', 'Quas nulla praeda um', 'Comprador'),
(50, 'Habemus, quae percipitur omni dolore careret, non modo nullam captet, sed.', 'An ille tempus aut in dolore. Omnis autem privatione doloris putat Epicurus terminari summam.', 'Quem tandem hoc stat', 'Vendedor'),
(51, 'Gymnasia, si campum, si canes, si equos, si ludicra exercendi aut venandi consuetudine adamare solem', 'Iuvaret. An ille tempus aut in liberos atque in sanguinem suum tam crudelis fuisse, nihil ut de util', 'In hae esse rogatiun', 'Corretor'),
(52, 'Universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, disc', 'Notionem, ut alterum esse appetendum, alterum aspernandum sentiamus. Alii autem, quibus ego assentio', 'De qua omne certamen', 'Locador'),
(53, 'Domesticarum rerum fastidium. Non est omnino hic docendi locus; sed.', 'Efficere possimus, molestia liberemus. Ut.', 'De dividendo ac part', 'Vendedor'),
(54, 'Pueri, mutae etiam bestiae paene loquuntur magistra ac duce natura nihil esse maius amicitia, nihil ', 'De litteris, quarum summum erat in utroque studium, deinde Torquatus: Quoniam nacti te, inquit, sumu', 'Dolorem et voluptate', 'Locador'),
(55, 'Reliquerunt. Sed hoc commune vitium, illae Epicuri propriae ruinae: censet enim eadem illa individua', 'Qui nec facile efficere possit, quod melius sit, migrare de vita. His rebus.', 'Cur in gravissimis r', 'Comprador'),
(56, 'Maxime gloriatur, primum totus est alienus. Democritea dicit perpauca mutans, sed ita, ut ea, quae s', 'Videri fuisse in imperio, quales eius maiores fuissent, et in conspectum suum venire vetuit, numquid', 'Vero et Rutilius mul', 'Corretor'),
(57, 'Alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob caus', 'Iucunde vivere. Id qui in una virtute ponunt et splendore nominis capti.', 'Tum amorem effloresc', 'Comprador'),
(58, 'Vel extremum -- quod et posse fieri intellegimus et saepe disserui, Latinam linguam non modo singulo', 'Possum, in eo non arbitrantur. Erunt etiam, et ii quidem eruditi Graecis litteris, contemnentes Lati', 'Tradere et negent sa', 'Locador'),
(59, 'Suum iudicium retinent, ne voluptate victi faciant id, quod his libris quaeritur, qui sit finis, qui', 'Elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Qua', 'Ea tamen, quae te ip', 'Vendedor'),
(60, 'Solum incommoda, quae eveniunt inprobis, fugiendam inprobitatem putamus, sed multo etiam magis.', 'Propriae ruinae: censet enim eadem illa individua et solida corpora ferri deorsum suo pondere ad lin', 'Causas in eorum vita', 'Corretor'),
(61, 'Id omne oritur a sensibus; qui si omnes atomi declinabunt, nullae umquam cohaerescent, sive aliae de', 'Quisquam beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam.', 'Autem quidam Epicure', 'Locador'),
(62, 'Faciunt, ut ita dicam, et ad tranquillitatem ferant, quid est enim aut utilior aut ad beatam aut ad ', 'Eo ortum, tam inportuno tamque crudeli; sin, ut dolore suo.', 'Esset accusata et vi', 'Comprador'),
(63, 'Profecta vera esse non possunt et, si essent vera, nihil afferrent, quo iucundius, id est praesentib', 'Regula et iudicio ab eadem illa individua et solida corpora ferri deorsum suo pondere ad lineam, hun', 'Hoc placeat, moderat', 'Vendedor'),
(64, 'Istius philosophi non offendit; nam et complectitur verbis, quod vult, et dicit plane, quod intelleg', 'In quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit. Ne.', 'Praeter sedulitatem ', 'Corretor'),
(65, 'Est ullus investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum esset accusata', 'Modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur.', 'Dicantur, cur nec vo', 'Vendedor'),
(66, 'Amarissimam necesse est aut in poetis evolvendis, ut ego et Triarius te hortatore facimus, consumere', 'Quae mutat, ea corrumpit, quae sequitur sunt tota Democriti, atomi, inane, imagines, quae eidola nom', 'Ego arbitror unum vi', 'Locador'),
(67, 'Hoc, qui eum unum secutus esset.', 'Dicit plane, quod intellegam; et.', 'Gravissimas res cons', 'Comprador'),
(68, 'Aut voluptatem aut molestiam plus aut ad beatam aut ad bene vivendum aptior partitio quam illa, qua ', 'Est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque.', 'Salutandi causa uter', 'Corretor'),
(69, 'Quidem videtur. Ac fieri potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philos', 'In hae esse rogatiuncula delectatum: ''Numquidnam manus tua sic affecta, quem ad.', 'Alios a studiis. Qua', 'Corretor'),
(70, 'Erant, ad quorum iudicium elaboraret, et sunt illius scripta leviora, ut urbanitas summa appareat, d', 'Provident ob eamque debilitatem animi multi parentes, multi amicos.', 'Sensus, ut ita dicam', 'Locador'),
(71, 'Amici propter se ipsos penitus perdiderunt, sic robustus animus et excelsus omni est liber cura et a', 'Iudicari, sed animo etiam ac ratione intellegi posse et voluptatem ipsam per.', 'Distrahi possint, si', 'Comprador'),
(72, 'Ratio reperietur. Nam neque laborum perfunctio neque perpessio dolorum per se ipsam causam.', 'Uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus e', 'Intellegere, quid di', 'Vendedor'),
(73, 'A Latinis, quod inciderint in inculta quaedam et horrida, de malis Graecis Latine scripta deterius. ', 'Amicitia, nihil uberius, nihil iucundius. Nec vero quisquam.', 'Inducitur: finitas h', 'Vendedor'),
(74, 'Tenuit amicorum greges! Quod fit etiam nunc ab Epicureis. Sed ad rem redeamus; de hominibus dici non', 'De homine sensibus reliqui nihil est, necesse est, non expeteretur.', 'Potest esse dubium, ', 'Corretor'),
(75, 'Et operosam et perinde fructuosam relinqueret? Non ergo Epicurus ineruditus, sed ii indocti, qui, qu', 'Logikh dicitur, iste vester plane, ut mihi videtur, expediunt. Ut enim aeque doleamus animo, cum cor', 'Ab Homero Ennius, Af', 'Comprador'),
(76, '--, quamquam autem et praeterita et futura. Ut enim ad minima veniam, quis nostrud exercitation ulla', 'Qua quaeque res efficiatur, alterum, quae vis sit, quae quidque efficiat, de materia disseruerunt, v', 'Levamur superstition', 'Locador'),
(77, 'Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud ', 'Ipsam voluptatem, quia voluptas sit, aspernatur aut odit aut fugit, sed quia maiores consequatur. Ea', 'Quod nullam eruditio', 'Comprador'),
(78, 'Tota ab illo est, tum innumerabiles mundi, qui et oriantur et intereant cotidie. Quae etsi mihi null', 'Spe proposita fore levius aliquando, nulla praeterea neque praesenti nec expectata voluptate, quid e', 'Non placuit Epicuro ', 'Vendedor'),
(79, 'Nos vocet ad se et alliciat suapte natura, non potest esse dubium, quin id sit summum atque extremum', 'Amicos et nosmet ipsos diligamus, idcirco et hoc ipsum efficitur in amicitia, et amicitia cum.', 'In Ceramico Chrysipp', 'Corretor'),
(80, 'Omnes bene sanos in viam placatae, tranquillae, quietae.', 'Sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate vivere.', 'Meminerit maximos mo', 'Locador'),
(81, 'Dolorem. Ad haec et quae fugiamus refert omnia. Quod quamquam Aristippi est a Cyrenaicisque melius l', 'Legendus sit. Rudem enim esse omnino in nostris poetis aut inertissimae segnitiae est aut fastidii d', 'Potiora. Quid est cu', 'Comprador'),
(82, 'Domus; quo minus animus a se repellere, idque facere nondum.', 'Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Aliena dixit in phys', 'Solum iactant nec ta', 'Locador'),
(83, 'Cum ea, quae hoc non minus declarant, sed.', 'Reliquerunt. Sed hoc commune vitium, illae Epicuri propriae ruinae: censet enim eadem illa atomorum,', 'Molestiae consequatu', 'Vendedor'),
(84, 'Inquit; audire enim cupio, quid non probes eius, a quo dissentias. Quid enim me.', '--, sic isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est non miser. ', 'Et dolores nasci fat', 'Corretor'),
(85, 'Minimum, quod profecto numquam putavisset, si a Polyaeno, familiari suo, geometrica discere maluisse', 'Id est in quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit.', 'Futuris, sed expecta', 'Comprador'),
(86, 'In infinito inani, in quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum.', 'Omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis.', 'Inviti legant. Quis ', 'Corretor'),
(87, 'Sed certe non probes, eum.', 'Et Siculis scribere. Facete is quidem, sicut alia; sed neque tam docti tum erant, ad quorum iudicium', 'Liberabuntur: istae ', 'Vendedor'),
(88, 'Ne temperantiam quidem propter se ipsos diligant. Quod et acutum genus est.', 'Quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem', 'Extremum bonorum omn', 'Locador'),
(89, 'Et sine metu degendae praesidia firmissima. -- Filium.', 'Pertinax non ero tibique, si mihi probabis ea, quae corrigere vult, mihi quidem videtur, inermis ac ', 'Ait ille, sciscat et', 'Corretor'),
(90, 'Optari, quia voluptatem. Iustitia restat, ut de utilitatibus, nihil ut de utilitatibus, nihil ut de.', 'Confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso ', 'Inquit, non satisfac', 'Locador'),
(91, 'Iis artibus, quas qui tenent, eruditi appellantur -- aut ne.', 'Si non habeat, non admodum indoctis, totum hoc displicet philosophari. Quidam autem non tam id repre', 'Etiam, ut te consule', 'Comprador'),
(92, 'Plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, merere', 'Equos, si ludicra exercendi aut venandi consuetudine adamare solemus, quanto id in hominum consuetud', 'Factis non emolument', 'Vendedor'),
(93, 'Sic in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium ess', 'Usus civium non inutile, nosque ea scripta reliquaque eiusdem generis et legimus libenter et legemus', 'D. Silano emancipave', 'Locador'),
(94, 'Explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem.', 'Ego et Triarius te hortatore facimus, consumeret, in quibus hoc primum est in voluptate. Neque enim ', 'Et semper sollicitan', 'Comprador'),
(95, 'Et consuetudinum instituendarum voluntates fieri propter voluptatem; quod vero securi percussit fili', 'Quo iucundius, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinc', 'Initiis profecta ver', 'Corretor'),
(96, 'Tempus numquam est plurimum et, cum stultorum vitam cum sua comparat, magna.', 'Fructuosam relinqueret? Non ergo Epicurus ineruditus, sed ii indocti, qui.', 'Quod vitam adiuvet, ', 'Vendedor'),
(97, 'Nulla praeda umquam improbe parta minuit, sed potius inflammat, ut coercendi magis quam dedocendi es', 'Initiis profecta vera esse non possunt, victi et debilitati obiecta specie voluptatis tradunt se lib', 'Si plane sic vertere', 'Vendedor'),
(98, 'Tam inimicus paene nomini Romano est, qui alienae modum statuat industriae? Nam.', 'Pecuniae studuisse aut imperiis aut opibus aut gloriae. Nullas enim consequuntur voluptates.', 'Et parabilis et term', 'Corretor'),
(99, 'Tantis animi corporisque doloribus, quanti in hominem maximi cadere possunt, nulla spe proposita for', 'Sit numeranda nec in malis dolor, non existimant oportere nimium nos causae confidere, sed.', 'Autem morbi sunt cup', 'Comprador'),
(100, 'Necesse est effici, ut sapiens solum amputata circumcisaque inanitate omni et errore naturae finibus', 'Quod vult. Nam et praeterita grate meminit et praesentibus ita potitur, ut animadvertat quanta sint ', 'Non ergo Epicurus in', 'Locador');
